Information
------------------------------

The Trojan War was a legendary battle, fought between the Spartan king Menelaus and Paris, Prince of Troy, over Helen, the woman so beautiful that 'her face could launch a thousand ships'. The setting for the final showdown was the fabled city of Troy. But did it ever exist and did the war really happen?
For centuries Troy remained little more than a myth, the place written about by the Ancient Greek poet, Homer, in his classic work the Iliad. Yet historians remained convinced that there must be more to Troy than a gripping tale.
Follow the fascinating story of how, in the 19th century, archaeologists uncovered the site of what is almost certainly the city of Troy, in north-western Turkey, and discover what really happened over the course of 3,000 years.

Produced by FilmRoos Inc. in association with A&amp;E Network

